        for (let n = 0; audios.length > n; n++) { audios[n].volume = 0.3; }

        //videoの数だけ全部音量0.5(=50%)
        const videos = document.getElementsByTagName('video');
        for (let n = 0; videos.length > 0; n++) { videos[n].volume = 0.3; }

    }
    /* ページ読み込み時に処理 */
